INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2015/12/17 15:00:00", 7001, 106001, 0.0, 0.0, 1, 1, "キャル", 0, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 7, 1, "2030/12/17 14:59:59", -363.0, 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2015/12/17 15:00:00", 7002, 105901, 0.0, 0.0, 1, 1, "コッコロ", 0, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 7, 1, "2030/12/17 14:59:59", -363.0, 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2015/12/17 15:00:00", 7003, 105801, 0.0, 0.0, 1, 1, "ペコリーヌ", 0, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 7, 1, "2030/12/17 14:59:59", -363.0, 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2015/12/17 15:00:00", 10001, 105801, 0.0, 0.0, 1, 1, "ペコリーヌ", 0, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 10, 1, "2030/12/17 14:59:59", -363.0, 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2015/12/17 15:00:00", 10002, 106001, 0.0, 0.0, 1, 1, "キャル", 0, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 10, 1, "2030/12/17 14:59:59", -363.0, 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2015/12/17 15:00:00", 10003, 105901, 0.0, 0.0, 1, 1, "コッコロ", 0, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 10, 1, "2030/12/17 14:59:59", -363.0, 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2015/12/17 15:00:00", 10004, 106401, 0.0, 0.0, 1, 2, "シェフィ", 0, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 10, 1, "2030/12/17 14:59:59", -363.0, 2104010);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2015/12/17 15:00:00", 12001, 105801, 0.0, 0.0, 1, 1, "ペコリーヌ", 0, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 12, 1, "2030/12/17 14:59:59", -416.5, 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2015/12/17 15:00:00", 13001, 106001, 0.0, 0.0, 1, 1, "キャル", 0, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 13, 1, "2030/12/17 14:59:59", -363.0, 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2015/12/17 15:00:00", 13002, 105901, 0.0, 0.0, 1, 1, "コッコロ", 0, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 13, 1, "2030/12/17 14:59:59", -363.0, 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2015/12/17 15:00:00", 13003, 106401, 0.0, 0.0, 1, 2, "シェフィ", 0, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 13, 1, "2030/12/17 14:59:59", -363.0, 2104010);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2015/12/17 15:00:00", 13004, 105801, 0.0, 0.0, 1, 1, "ペコリーヌ", 0, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 13, 1, "2030/12/17 14:59:59", -363.0, 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2015/12/17 15:00:00", 14001, 105901, 0.0, 0.0, 1, 1, "コッコロ", 0, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 14, 1, "2030/12/17 14:59:59", -363.0, 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2015/12/17 15:00:00", 14002, 106401, 0.0, 0.0, 1, 2, "シェフィ", 0, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 14, 1, "2030/12/17 14:59:59", -363.0, 2104010);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2015/12/17 15:00:00", 14003, 105801, 0.0, 0.0, 1, 1, "ペコリーヌ", 0, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 14, 1, "2030/12/17 14:59:59", -363.0, 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2015/12/17 15:00:00", 14004, 106001, 0.0, 0.0, 1, 1, "キャル", 0, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 14, 1, "2030/12/17 14:59:59", -363.0, 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2015/12/17 15:00:00", 15001, 105901, 0.0, 0.0, 1, 1, "コッコロ", 0, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 15, 1, "2030/12/17 14:59:59", -470.0, 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2015/12/17 15:00:00", 16001, 106401, 0.0, 0.0, 1, 2, "シェフィ", 0, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 16, 1, "2030/12/17 14:59:59", -363.0, 2104010);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2015/12/17 15:00:00", 16002, 105801, 0.0, 0.0, 1, 1, "ペコリーヌ", 0, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 16, 1, "2030/12/17 14:59:59", -363.0, 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2015/12/17 15:00:00", 16003, 106001, 0.0, 0.0, 1, 1, "キャル", 0, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 16, 1, "2030/12/17 14:59:59", -363.0, 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2015/12/17 15:00:00", 16004, 105901, 0.0, 0.0, 1, 1, "コッコロ", 0, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 16, 1, "2030/12/17 14:59:59", -363.0, 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2015/12/17 15:00:00", 17002, 105901, 0.0, 0.0, 1, 1, "コッコロ", 0, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 17, 1, "2030/12/17 14:59:59", -363.0, 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2015/12/17 15:00:00", 17004, 106001, 0.0, 0.0, 1, 1, "キャル", 0, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 25, 1, "2030/12/17 14:59:59", -363.0, 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2015/12/17 15:00:00", 17005, 105901, 0.0, 0.0, 1, 1, "コッコロ", 0, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 25, 1, "2030/12/17 14:59:59", -363.0, 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2015/12/17 15:00:00", 17006, 106401, 0.0, 0.0, 1, 2, "シェフィ", 0, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 25, 1, "2030/12/17 14:59:59", -363.0, 2104010);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2015/12/17 15:00:00", 17007, 105801, 0.0, 0.0, 1, 1, "ペコリーヌ", 0, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 25, 1, "2030/12/17 14:59:59", -363.0, 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2015/12/17 15:00:00", 18001, 190801, 0.0, 0.0, 1, 1, "カリン", 0, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 18, 1, "2030/12/17 14:59:59", -363.0, 0);
