INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2015/12/17 15:00:00", 21001, 106001, 0.0, 0.0, 1, 1, "キャル", 0, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 21, 1, "2030/12/17 14:59:59", -363.0, 0);
