INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2015/12/17 15:00:00", 21004, 105801, 0.0, 0.0, 1, 1, "ペコリーヌ", 0, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 21, 1, "2030/12/17 14:59:59", -363.0, 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2015/12/17 15:00:00", 22001, 190801, 0.0, 0.0, 1, 1, "カリン", 0, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 22, 1, "2030/12/17 14:59:59", -430.0, 0);
