INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2015/12/17 15:00:00", 23002, 190801, 0.0, 0.0, 1, 1, "カリン", 0, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 23, 4, "2030/12/17 14:59:59", -430.0, 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2019/01/31 12:00:00", 24001, 109001, 4.08, 8.0, 2, 1, "エリコ（バレンタイン）", 10011, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 24, 1, "2030/12/17 14:59:59", -385.0, 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2019/01/31 12:00:00", 24002, 109001, 5.0, 8.0, 2, 1, "エリコ（バレンタイン）", 10011, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 24, 2, "2030/12/17 14:59:59", -385.0, 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2019/01/31 12:00:00", 24003, 109001, 10.11, 8.0, 2, 1, "エリコ（バレンタイン）", 10011, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 24, 3, "2030/12/17 14:59:59", -385.0, 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2019/01/31 12:00:00", 24004, 109001, 4.0, 8.0, 2, 1, "エリコ（バレンタイン）", 10011, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 24, 4, "2030/12/17 14:59:59", -385.0, 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2019/01/31 12:00:00", 24005, 109001, 6.0, 8.0, 2, 1, "エリコ（バレンタイン）", 10011, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 24, 5, "2030/12/17 14:59:59", -385.0, 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2019/01/31 12:00:00", 24006, 109002, 0.0, 0.0, 1, 1, "エリコ（バレンタイン）", 10011, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 24, 6, "2030/12/17 14:59:59", 0.0, 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2019/01/31 12:00:00", 24007, 109002, 0.0, 0.0, 1, 1, "エリコ（バレンタイン）", 10011, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 24, 7, "2030/12/17 14:59:59", 0.0, 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2019/01/31 12:00:00", 24008, 109002, 0.0, 0.0, 1, 1, "エリコ（バレンタイン）", 10011, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 24, 8, "2030/12/17 14:59:59", 0.0, 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2019/01/31 12:00:00", 24009, 109002, 0.0, 0.0, 1, 1, "エリコ（バレンタイン）", 10011, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 24, 9, "2030/12/17 14:59:59", 0.0, 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2019/01/31 12:00:00", 24010, 109002, 0.0, 0.0, 1, 1, "エリコ（バレンタイン）", 10011, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 24, 10, "2030/12/17 14:59:59", 0.0, 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2019/01/31 12:00:00", 24011, 109101, 2.12, 8.0, 2, 1, "シズル（バレンタイン）", 10011, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 24, 1, "2030/12/17 14:59:59", -385.0, 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2019/01/31 12:00:00", 24012, 109101, 4.19, 8.0, 2, 5, "シズル（バレンタイン）", 10011, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 24, 2, "2030/12/17 14:59:59", -385.0, 0);
